import React from 'react'
import { CFooter } from '@coreui/react'

const AppFooter = () => {
  return (
    <CFooter>
      <div>
        <span className="ms-1">&copy; 2023 TIP Group 1</span>
      </div>
    </CFooter>
  )
}

export default React.memo(AppFooter)
